import React, { Component } from 'react';
import {View, Text, TouchableOpacity,Image, StyleSheet} from 'react-native'

export default class VoteView extends Component {
  render() {
    return (
      <View>
        <Text style={styles.h2}>OK21 - Kommunal</Text>
        <Text style={styles.readmore}><TouchableOpacity style={{textDecoration: 'underline'}}>Read more about OK21</TouchableOpacity></Text>
        <Text style={styles.h3}>Note that you have only one vote. When you have ticked or either yes or no, click on ‘Submit Vote’ and then ‘Confirm Vote’.</Text>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  h2: {
    fontSize: 32,
    fontWeight: 700,
    color: '#fff',
    marginBottom: 4
  },
  readmore: {
    fontSize: 14,
    fontWeight: 400,
    color: '#fff',
    marginBottom: 18
  },
  h3: {
    fontSize: 14,
    fontWeight: 700,
    color: '#fff',
    marginBottom: 18
  }
})
